import Navigation from "./navigation";

function Welcome() {
    return (
        <div>
            <Navigation/>
            <div style={{margin:'auto'}}>
                <center><h2>Welcome</h2></center>
                <center><h2>Happy Shopping!!! </h2></center>
            </div>
        </div>
    )
}
export default Welcome;
